package priv.algorithm.leetcode.hash;

import org.testng.annotations.Test;

import java.util.HashMap;
import java.util.Map;

/**
 * @author: klien.zq
 * @description: 有效的字母异位词
 * @date: 2022/4/18 11:35
 */
public class LeetCode242 {

    public boolean isAnagram(String s, String t) {
        Map<Character, Integer> refer = new HashMap<>();
        Map<Character, Integer> refer2 = new HashMap<>();

        for (char a : s.toCharArray()) {
            refer.put(a, refer.getOrDefault(a, 0) + 1);
        }

        for (char b : t.toCharArray()) {
            refer2.put(b, refer2.getOrDefault(b, 0) + 1);
        }

        if (refer.size() != refer2.size()) return false;
        for (Map.Entry<Character, Integer> m : refer.entrySet()) {
            if (!refer2.containsKey(m.getKey()) || refer2.get(m.getKey()).compareTo(m.getValue()) != 0){
                return false;
            }
        }

        return true;
    }

    /**
     * 由于第一种方案无条件遍历2个，所以优化下
     * @param s
     * @param t
     * @return
     */
    public boolean isAnagram2(String s, String t) {
        if (s.length() != t.length()) return false;
        Map<Character, Integer> refer = new HashMap<>();

        for (char a : s.toCharArray()) {
            refer.put(a, refer.getOrDefault(a, 0) + 1);
        }

        for (char b : t.toCharArray()) {
            refer.put(b, refer.getOrDefault(b, 0) - 1);
            if (refer.get(b).compareTo(0) < 0) {
                return false;
            }
        }
        return true;
    }

    @Test
    public void testCase() {
        System.out.println(isAnagram("",
                ""));
        System.out.println(isAnagram2("",
                ""));

    }
}
